import React from 'react';

export const Boton = ({ color, texto }) => {
    return (
        color === 'verde'
            ?
            <a className='text-md px-6 py-2 rounded-md bg-green-500 text-indigo-50 font-semibold cursor-pointer' target="_blank" rel="noreferrer">{texto}</a>
            :
            <a className='text-md px-6 py-2 rounded-md bg-red-500 text-indigo-50 font-semibold cursor-pointer' target="_blank" rel="noreferrer">{texto}</a>
    )
}
